import { createStore } from 'redux'
import {
    composeWithDevTools
} from 'redux-devtools-extension'
import rootReducer from '../reducers'

const initialState = {
    initialJobs: [],
    jobsRes: [],
    filter: {
        searchQuery: "",
        locationQuery: ""
    }
}

const store = () => {
    return createStore(
        rootReducer,
        initialState,
        composeWithDevTools()
    )
}

export default store
